import React from "react";

import styles from "./Blog.module.css";

import TemplateBlog from "../BlogPosts/TemplateBlog/TemplateBlog"

const Blog = () => {
  return (
    <div style={styles.blogPosts}>
      <TemplateBlog header="My Vim Setup" topic="vim" short_text="This blog post is a guide on how to create the simple and effective .vimrc setup that I personally use for studying and development" date_posted="Mar 7 2024" />
    </div>
  )
}

export default Blog
